import React, { Fragment } from 'react'
import './GameBar.css'
import { Container } from 'reactstrap'
import {
	Message
} from '../../../components'


export const GameBar = ({value, color, url}) => {
	return (
		<Container className='d-flex justify-content-left align-items-center'>
			<img width='100px' height='100px' src={url}/>
			<Message text='kek' isOpen={true} />
			<div className='game-bar' style={{width:value, background:color}}/>  
		</Container>
	)
}
